import React from "react";
import { Footer } from "../Componentes/Footer";
import { Nav } from "../Componentes/Nav";
import imgError from "../assets/img/NotFound/NotFound.jpg"
import './NotFound.css'

function NotFound(){
    return(
        <>
        <Nav></Nav>
        <div className="img404">
              <img src={imgError}/>
        </div>
      
        <Footer></Footer>
        </>
    )
}

export {NotFound}
